import React, { useEffect, useState } from "react";
import "../css/KakaoMapModal.css";

const loadKakaoSDK = () => {
  return new Promise((resolve) => {
    if (window.kakao && window.kakao.maps) {
      resolve(window.kakao);
    } else {
      const script = document.createElement("script");
      script.src =
        "https://dapi.kakao.com/v2/maps/sdk.js?appkey=2380b0c6e08137415b69715b13439001&autoload=false&libraries=services";
      script.async = true;
      document.head.appendChild(script);
      script.onload = () => resolve(window.kakao);
    }
  });
};

export default function KakaoMapModal({ onSelect }) {
  const [mapInstance, setMapInstance] = useState(null);
  const [marker, setMarker] = useState(null);
  const [searchInput, setSearchInput] = useState(""); // ✅ 검색어 상태

  useEffect(() => {
    loadKakaoSDK().then((kakao) => {
      kakao.maps.load(() => {
        const container = document.getElementById("kakao-map");
        if (!container) return;

        let defaultLatLng = new kakao.maps.LatLng(37.5665, 126.9780);

        if (navigator.geolocation) {
          navigator.geolocation.getCurrentPosition(
            (position) => {
              defaultLatLng = new kakao.maps.LatLng(
                position.coords.latitude,
                position.coords.longitude
              );
              initMap(defaultLatLng);
            },
            () => initMap(defaultLatLng)
          );
        } else {
          initMap(defaultLatLng);
        }

        function initMap(centerLatLng) {
          const map = new kakao.maps.Map(container, { center: centerLatLng, level: 3 });
          const newMarker = new kakao.maps.Marker({ position: centerLatLng, map });
          setMapInstance(map);
          setMarker(newMarker);

          kakao.maps.event.addListener(map, "click", (mouseEvent) => {
            const latlng = mouseEvent.latLng;
            newMarker.setPosition(latlng);
            const geocoder = new kakao.maps.services.Geocoder();
            geocoder.coord2Address(latlng.getLng(), latlng.getLat(), (result, status) => {
              if (status === kakao.maps.services.Status.OK) {
                onSelect({
                  address: result[0].address.address_name,
                  lat: latlng.getLat(),
                  lng: latlng.getLng(),
                });
              }
            });
          });
        }
      });
    });
  }, [onSelect]);

  // ✅ 검색 기능: Kakao Places API 사용
  const handleSearch = () => {
    if (!searchInput.trim()) return;
    const ps = new window.kakao.maps.services.Places();

    ps.keywordSearch(searchInput, (data, status) => {
      if (status === window.kakao.maps.services.Status.OK) {
        const firstResult = data[0];
        const lat = parseFloat(firstResult.y);
        const lng = parseFloat(firstResult.x);

        if (mapInstance && marker) {
          const moveLatLng = new window.kakao.maps.LatLng(lat, lng);
          mapInstance.setCenter(moveLatLng);
          marker.setPosition(moveLatLng);

          // ✅ 선택된 위치 정보 전달
          onSelect({
            address: firstResult.address_name || firstResult.place_name,
            lat: lat,
            lng: lng,
          });
        }
      } else {
        alert("검색 결과가 없습니다.");
      }
    });
  };

  const cityCenters = {
    서울: { lat: 37.5665, lng: 126.9780 },
    부산: { lat: 35.1796, lng: 129.0756 },
    대구: { lat: 35.8714, lng: 128.6014 },
    인천: { lat: 37.4563, lng: 126.7052 },
    광주: { lat: 35.1595, lng: 126.8526 },
    대전: { lat: 36.3504, lng: 127.3845 },
  };

  return (
    <div>
      {/* ✅ 검색창 */}
      <div className="search-container">
        <input
          type="text"
          placeholder="원하는 위치 검색"
          value={searchInput}
          onChange={(e) => setSearchInput(e.target.value)}
          className="modal-search"
        />
        <button className="search-btn" onClick={handleSearch}>검색</button>
      </div>

      <div id="kakao-map" className="kakao-map"></div>

      {/* ✅ 주요 도시 버튼 */}
      <div className="city-grid">
        {Object.keys(cityCenters).map((city) => (
          <button
            key={city}
            className="city-btn"
            onClick={() =>
              onSelect({
                address: city,
                lat: cityCenters[city].lat,
                lng: cityCenters[city].lng,
              })
            }
          >
            {city}
          </button>
        ))}
      </div>
    </div>
  );
}
